window.bookSummaryJSON = "<p><b>To win their queen’s heart, this pair must risk it all.</b></p> <p>Royan Watson lived by three simple rules: no regrets, no relationships, and no slowing down. No exceptions. Then steady, reliable, and sexy-as-hell Owen Connors crossed his orbit, and Royan’s rules went out the airlock.</p> <p>Astek station is in chaos, and Tianna Astor has been sent to set things right. But no briefing or data files could prepare the ice queen of Astek Corp for the secrets, lies, and temptations she’ll find out at the edge of civilized space.</p>"; 
